column8:
　ケースを付けたまま充電、マナーモード使用、音量調整などすべての操作が可能です。
完全防水だけではなく、弾力ある素材も加えて軽くて耐衝撃にも優れます。
従来の防水ケースより長くお使いいただけます。
防水ケース装着したまま、すべてのポートやコントロールは自由に使います。
ヘッドフォン用アダプターを使えばお風呂場でも好きな音楽を楽しめます。
クリアなサウンドで通話も快適。ストラップ付き、指紋認証もできます。<!--  ----------------------------------------
 ▽右バナー
